import axios from "axios";

import React, { useEffect } from "react";

const Practice = () => {
  const getPost = async () => {
    const response = await axios.get("http://127.0.0.1:8000/api/");
    console.log(response.data);
  };

  useEffect(() => {
    getPost();
  }, []);

  return <div>Hey!</div>;
};

export default Practice;
